<html><head><meta http-equiv="Content-Type" content="text/html; charset=windows-1252">
    <script>
			var px = -1;
			var py = -1;
			var current = "";
			var regionsDump = "";
      function move(e) {
        var svg = document.getElementById("svg");
        var x = (e.clientX + document.body.scrollLeft) / (1.0 * svg.clientWidth) * 1054 + 5;
        var y = (e.clientY + document.body.scrollTop) / (1.0 * svg.clientHeight) * 1045;
        //document.getElementById("debug").innerHTML = x.toFixed(2) + ", " + y.toFixed(2);
      }
			function reset() {
				current = "";
				document.getElementById("clickpath").setAttribute("d", current);
				px = -1;
				py = -1;
			}
			function done() {
				if (current == "") {
					return;
				}
				current += "Z";
				var n = document.createElementNS("http://www.w3.org/2000/svg", "path");
				n.setAttribute("d", current);
				var p = document.getElementById("sea_regions");
				p.insertBefore(n, p.firstChild);
				regionsDump = "<path d=\"" + current + "\"></path>\n" + regionsDump;
				document.getElementById("dumpArea").value = regionsDump;
				reset();
			}
      function click(e) {

        var svg = document.getElementById("svg");
        var x = (e.clientX + document.body.scrollLeft) / (1.0 * svg.clientWidth) * 1154 - 50;
        var y = (e.clientY + document.body.scrollTop) / (1.0 * svg.clientHeight) * 1300 - 50;
        console.log(document.getElementById("debug").innerHTML);
				if (px != -1 || py != -1) {
					if (current == "") {
						current = "M" + px +","+py;
					}
					var p = split(e.ctrlKey ? 0 : Math.log2(Math.sqrt((x-px)*(x-px)+(y-py)*(y-py)) / 5), px, py, x, y);
					for (var i = 0; i < p.length; i++) {
						current += " L" + p[i][0] + "," + p[i][1];
					}
					document.getElementById("clickpath").setAttribute("d", current);
				}
				px = x;
				py = y;
      }
			function split(depth, x1, y1, x2, y2) {
				if (depth <= 0) {
					return [[x2, y2]];
				}
				var offset = (Math.random() * 2 - 1) / 4;
				var perp = [y2 - y1, x1 - x2];
				var cx = (x1 + x2) / 2 + offset * perp[0]
				var cy = (y1 + y2) / 2 + offset * perp[1];
				return split(depth - 1, x1, y1, cx, cy).concat(split(depth - 1, cx, cy, x2, y2));
			}

			// Region Annotation
			function regionClick(ev) {
				console.log(ev.target.id);
			}

			function regionMouseover(ev) {
			}
    </script>
